public class eje16 {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=0;i<=10;i++){
			for(int e=0;e<=10;e++){
				System.out.println(e);
			}
			System.out.println("-------------------------");
		}

	}

}
